import { LOAD_USERS,LOAD_QUESTIONS,LOAD_SELECTED_ITEM } from "./types";



export function loadUsers(users){
return {type:LOAD_USERS,users}
}

export function loadQuestions(questions){
    return {type:LOAD_QUESTIONS,questions}
    }


export function loadSelectedItem(selectedItem){
        return {type:LOAD_SELECTED_ITEM,selectedItem}
        }
